import Vue from 'vue'
import Router from 'vue-router'


Vue.use(Router)

// 页面路由(独立页面)
export const pageRoutes = [
  {
    path: '/',
    component: () => import('@/views//404'),
    name: 'chat',
  },
  { path: '/', component: () => import('@/views/modules/message-box'), name: 'login', meta: { title: '登录' } }
]
